import classes from '/h'
import meals from '../../assets/meals.jpg'



const Header = () => {
    return ( 
        <>
        <header className={classes.header}>
            <h1>ReactMeals</h1>
            <button>Cart</button>
        </header>
        <div>
            <img src={meals} alt="" />
        </div>
        </>
     );
}
 
export default Header;
